import React, { Component } from "react";
import Task from "./task";
import NothingBlock from "./nothing_block";
import UnAuthorized from "./unauthorized";

export default class TaskList extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }


  render() {

    render_list_block = () => {
      if(!this.props.auth){
        return <UnAuthorized/> 
      }
      else if(this.props.task < 1){
        return <NothingBlock />
      }
      else{
        return <div className="task_list mt-3">
            {Object.keys(this.props.tasks).map((key) => {
              return (
                <Task
                  title={this.props.tasks[key].title}
                  key={key}
                  date_ending={this.props.tasks[key].date_ending}
                />
              );
            })}
          </div>
      }
    }


    return (
      <>
      {render_list_block()}
      </>
    );
  }
}
